import React from "react";
import NavBar from "./NavBar";
import ToDoList from "./ToDoList";
import {BrowserRouter, Switch, Route} from 'react-router-dom'


class App extends React.Component{
    render(){
        return(
            <section id="todo">
                <BrowserRouter>
                    <Switch>
                        <Route />
                    </Switch>
                </BrowserRouter>


                <ToDoList />
                <NavBar />
            </section>
        )
    }
}

export default App
